h[/b]\n\n[b]List the things you did before the bug happened[/b]\n\n[b]Include any other information that will help reproduce the bug.[/b]\n- What type of server were you on? MM? Casual? Community deathmatch?\n\n[b]Include screenshots of your settings[/b]',0,1528877959,NULL,NULL,12,NULL,NULL),(13,'admin',2,'84.244.45.54',NULL,'Have a bug report that you feel like doesn\'t need a thread?\n\nPost it here.\n\nBug reports, Nothing else.\n\n[b]Bug format(ensures it will be fixed)[/b]\n-Feature\n-What happened\n-Any information that helps in reproducing\n-What type of server it was(nospread, spread, valve mm, hs only, etc)\n-Screenshot of your settings/export of your settings\n-A video of the bug happening(if possible, not always needed if reproduce information is good enough)\n\n[b]Example[/b]\nFeature: Bounding box\nWhat happened: I enabled it and bounding boxes did not appear on enemys/teammates\nReproduce: Enabling the feature\nServer type: Valve MM\nScreenshot: (screenshot of visuals, misc, rage)\nVideo: No video needed',0,1528878014,NULL,NULL,13,NULL,NULL),(14,'admin',2,'84.244.45.54',NULL,'Have a small suggestion that doesn\'t need a thread?\n\nPost it here.\n\nSuggestions, Nothing else.\n\nThese suggestions are prioritized by admin.\n\n[b]Suggestion format[/b]\n-Feature\n-How does it help?\n-Where would it be useful?\n\n[b]Example[/b]\nFeature: Aimbot\nHow does it help?: Automatically aiming at players ensuring an edge over others\nWhere would it be useful?: In any situation where your mouse aim would lack',0,1528878048,NULL,NULL,14,NULL,NULL),(15,'admin',2,'84.244.45.54',NULL,'- Nothing illegal\n- Anyone scamming will be permanently banned without warning\n- Nothing related to any other provider (e.g. dumps, configs)\n\nInclude \"WTB\" (want to buy) in your topic title if you are looking to buy.\nInclude \"WTS\" (want to sell) in your topic title if you are selling.\nThis is temporary, in the future I\'ll add official topic tags.',0,1528878074,NULL,NULL,15,'a:4:{i