d in the HWID textbox\n\nClick the Reset HWID button\n\nWait for a staff member to accept your reset\n\nInvite information\n\nThis section will explain the requirements to receive invites and how to get them. Invites are given out at the staff teams discretion meaning that just because you meet the requirements below doesn\'t mean you are guaranteed or entitled to an invite.\n\nRequirements\nFor a staff member to consider giving you an invite your account must meet all of the requirements below.\n\nHave an active subscription\n\nRegistered for at least a month\n\nMust not be invited by a banned user (may differ to users depending on their ban reason)\n\nMust not have invited banned user (may differ to users depending on their ban reason)\n\nBeing registered for a month means you\'re eligible to receive an invite, in the end the staff will decide when they hand out the invites\n\nHow to get invites\n\nMake an invite request by private messaging me in the forum\n\nHow to enable 2FA\n\nDownload the authentication app of your choice (Authy, Google Authenticator, etc)\n\nGo to your profile, enter the Authentication section\n\nClick the Enable 2FA button\n\nScan the QR code with the app you selected\n\nEnter the code from your app into the code section on the website\n\nNote: GameSense is not responsible for your account / computers security. It is your responsibility to ensure your account details, and your computer is secure. Your username and password should not be shared with anyone for any reason and two factor authentication should be enabled. Any account that is being shared, or that is stolen will be banned immediately.',0,1614117087,NULL,NULL,33,'a:1:{i:684;s:4:\"wish\";}',NULL),(48,'R឵឵estunoa',29,'85.190.80.86',NULL,'hi',0,1614545798,NULL,NULL,41,NULL,NULL),(49,'admin',2,'148.74.74.83',NULL,'Banned',0,1614546077,NULL,NULL,41,NULL,NULL),(39,'admin',2,'148.74.74.83',NULL,'Need some help with a script? Post below.',0,1614121506,NULL,NULL,35,NULL,NULL),(40,'admin',