,NULL,NULL),(597,'admin',2,'144.62.234.227',NULL,'bro thinks hes bro :skull:',0,1661007142,NULL,NULL,233,'a:1:{i:654;s:8:\"cloudyx2\";}',NULL),(605,'cloudyx2',654,'79.118.6.65',NULL,'[quote=admin]bro thinks hes bro :skull:[/quote] bro thinks bro and his bro cant give the bro a bro sub :skull:',0,1661238563,NULL,NULL,233,NULL,NULL),(594,'admin',2,'144.62.234.227',NULL,'Updated / Fixed',0,1660584309,NULL,NULL,222,NULL,NULL),(581,'Hurblikeskids420',637,'162.158.91.136',NULL,'sex',0,1659732951,NULL,NULL,186,'a:1:{i:69;s:4:\"19v8\";}',NULL),(616,'IlikeKoks',504,'172.70.243.28',NULL,'1. Change your password to something simple with 2 numbers (example: password27)\n2. Open Registry by searching from your taskbar\n3. Press \"ctrl + f\" to search up \"gamesense\" and wait for the results\n4. You should end up in a folder called \"gamesensed\"\n[img=img1]https://cdn.discordapp.com/attachments/1012389555128770621/1014283724109656106/unknown.png[/img]\n5. You will see 4 values, The first will be unspecified, Delete the other 3 values that hold your login info and uid\n[img=img2]https://cdn.discordapp.com/attachments/1012389555128770621/1014284033288568948/grafik.jpg[/img]\n6. Youre done! you know can start the loader and enter your newly created credentials.\n\nIm posting this because admin hasn\'t added this to the common issues section yet and im recieving lots of pms on discord about it',0,1661894937,NULL,NULL,241,NULL,NULL),(617,'Fabusz',695,'172.68.50.149',NULL,'Czas przygotowania: 2 godziny\nCzas duszenia: 2 dni\nLiczba porcji: 5 kg bigosu\n\nKaloryczność kcal: 190 w 100 g bigosu\nDieta: bezglutenowa\n\nSkładniki:\n1 kg kapusty świeżej - pół średniej główki\n2 kg kapusty kiszonej + 2,5 szklanki wody do gotowania\n80 g suszonych grzybów + 500 ml wody do moczenia\n500 g łopatki wieprzowej\n300 g łopatki wołowej\n500 g boczku surowego bez skóry\n500 g schabu wieprzowego od karku\n50 g smalcu wieprzowego\n180 g kiełbasy myśliwskiej podwędzanej\n150 g boczku surowego wędzonego\n150 g boczku parzonego wędzonego\n2 duże cebule - do 400 g\n50 g suszonych śliwek bez pestek - lub więcej\n1 szklanka czerwonego, wytrawnego wina - można pominąć\nprzyprawy i zioła: 5 ziaren ziela angielskiego, łyżeczka czarnego pieprzu, 5 liści laurowych, 1 goździk, 2 ziarna jałowca\nBigos\nSzklanka ma u mnie pojemność 250 ml. \nWarzywa ważone były przed ewentualnym obraniem/przygotowaniem.\n\nKalorie policzone zostały na podstawie użytych przeze mnie składników. Jest to więc orientacyjna ilość kalorii liczona na podstawie produktów, których użyłam w danym przepisie. Z podanej ilości składników otrzymasz około pięciu kilogramów domowego bigosu.\n\nPrzed szykowaniem przepisu zachęcam też do przeczytania najpierw całego wpisu. W treści podaję bowiem dużo ciekawych porad dotyczących składników oraz ich zamienników. Być może zapragniesz coś zmienić, z czegoś zrezygnować lub dokupić jakąś przyprawę.\n\nDo duszenia bigosu polecam użyć garnka emaliowanego, żeliwnego emaliowanego lub garnka z mocną i nieprzywierającą powłoką o pojemności minimum siedmiu litrów. Nie używamy zaś garnków aluminiowych.\n\nMój przepis na bigos domowy zawiera w składzie bardzo dużo mięsa. Zdaję sobie sprawę z tego, że większość z Was nie daje do bigosu tak dużej ilości mięs i wędzonek. Ja daję... ale jeśli Wy chcecie ograniczyć ilość mięsa w bigosie, to śmiało możecie zrezygnować np. z dodatku surowego schabu lub boczku oraz np. z boczku surowego wędzonego lub parzonego wędzonego. W bigosie będzie wówczas mniej mięsa, ale reszta składników (również przyprawy) pozostaje bez zmian.',0,1661902494,NULL,NULL,242,NULL,NULL),(618,'Fabusz',695,'172.68.50.161',NULL,'Sposób przygotowania:\n\nSchab umyj i osusz, pokrój w plastry na grubość ok. 1 cm. Rozgrzej patelnię bez tłuszczu.\nNa rozgrzaną patelnię (ok. 150ºC) połóż mięso i delikatnie je „przypal” przez 3-4 minuty.\nGdy schab się zarumienił i zostawił aromat na patelni, włóż cebulę pokrojoną w plastry.\nPo kilku minutach, aż cebula się zeszkli i zalej schab wodą tak, by kawałki były przykryte. Całość posyp solą i pieprzem. ...\nMąkę rozmieszaj w 10 ml zimnej wody, wymieszaj i zalej schab w sosie.\nŚmietanę w temp. pokojowej dodaj do mięsa. Lekko wymieszaj, by całość się połączyła i zdejmij z ognia.\nPietruszkę posiekaj na drobno i dodaj do schaby w sosie własnym.',0,1661902591,NULL,NULL,243,NULL,NULL),(619,'Fabusz',695,'172.68.50.149',NULL,'PRZYGOTOWANIE\nDo dużego garnka wlać 2 litry wody, dodać wołowinę, 1 łyżeczkę soli i zagotować. Gotować pod przykryciem przez ok. 1 i 1/2 godziny.\nDodać marchewkę, pietruszkę, pora, selera oraz opaloną na palniku cebulę, gotować przez ok. 30 minut pod przykryciem.\nDodać boczek, podziurkowaną widelcem białą kiełbasę, zupę spróbować i doprawić solą. Gotować przez ok. 15 minut na małym ogniu pod przykryciem.\nDodać wędzoną kiełbasę, obrany czosnek (1 ząbek można rozgnieść), liść laurowy, ziele angielskie, pieprz czarny, pieprz ziołowy, majeranek, otręby, chrzan, sok z cytryny lub ocet. Gotować przez ok. 5 minut.\nŚmietankę wymieszać z 2 łyżkami wody oraz z mąką. Następnie dodać do zupy i delikatnie zagotować.\nPROPOZYCJA PODANIA\nugotowane na twardo jajka / kiełbasa z wywaru / natka pietruszki\n\nWSKAZÓWKI\nJeśli kiełbasę będziemy piec w piekarniku, wyjmujemy ją z wywaru już po 10 minutach gotowania. Przed pieczeniem nacinamy na ukos i pieczemy w piekarniku z funkcją grilla (ok. 220 stopni C) przez ok. 15 minut na lekko złoty kolor. Na patelni na oleju z dodatkiem pokrojonego w kosteczkę boczku z wywaru, poddusić pokrojoną w piórka cebulę. Podawać do kiełbasy.',0,1661902697,NULL,NULL,244,'a:1:{i:684;s:4:\"wish\";}',NULL),(620,'Fabusz',695,'172.68.50.233',NULL,'[url]https://www.youtube.com/watch?v=CatB_fPqbAo[/url]',0,1661902855,NULL,NULL,245,NULL,NULL),(621,'MINEX',694,'195.91.17.134',NULL,'Thank you so much <3',0,1661923638,NULL,NULL,241,NULL,NULL),(622,'MINEX',694,'176.118.100.34',NULL,'So i already have C:sblua and cfg folder in C:sblua is blank.lua \nin csgo\'s gsws fold