isabled.\n\n[b]Known incompatible vendors:[/b] HitmanPro.Alert\n\n[b]Client not opening?[/b]\n\nIf nothing happens when you open the client, then try enabling UAC and restarting Steam. Set it to its default setting, which is one notch from the top.\n\n[b]Menu shows as a solid black rectangle[/b]\n\nGo to CS:GO settings and enable \"multi core rendering\".\n\n[b]Menu not displaying or flickering[/b]\n\nRemove \'nod3d9ex\' from your launch options.\n\nMake sure the Steam overlay is enabled. Check it is enabled in both of these places: - Steam > Settings/Preferences > In-game tab. Check the box next to Enable the Steam Overlay while in-game. - Right-click CS:GO in your Library > Select Properties > Under the General tab, check the box next to Enable the Steam Overlay while in-game.\n\n[b]\"Hide from OBS\" not working[/b]\nTurn off or disable Razer Synapse.\n\nIn your NVIDIA Control Panel, go to \'Manage 3D settings\' and be sure the following options match your Global Settings: - Antialiasing - FXAA - Off - Antialiasing - Mode - Application-controlled - Multi-Frame Sampled AA (MFAA) - Off - Shader Cache - On - Texture filtering - Anisotropic sample optimization - Off - Texture filtering - Negative LOD bias - Allow - Texture filtering - Quality - Quality - Texture filtering - Trilinear optimization - On - Threaded optimization - Auto - Triple buffering - Off - Vertical sync - Use the 3D application settingBe sure you do not have conflicting settings for CS:GO in the Program Settings tab.\n\n[b]Initialization Failed *[/b]\n\nCan happen if you played a Battleye or EAC protected game, Restart PC or disable the BE/EAC service.\n\n[b]Client closing right after you open it[/b]\n\nInstall the game that your subscription is for. Make sure invitees understand that Windows 8.1 or newer is required.',0,1664550965,NULL,NULL,264,'a:1:{i:684;s:4:\"wish\";}',NULL),(706,'admin',2,'148.76.225.107',NULL,'Updated',0,1664551055,NULL,NULL,33,'a:1:{i:629;s:7:\"dankuul\";}',NULL),(710,'Rize',